    @objc dynamic public class func drawBackwardArrow(frame targetFrame: CGRect = CGRect(x: 0, y: 0, width: 317, height: 384), resizing: ResizingBehavior = .aspectFit) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()!
        
        //// Resize to Target Frame
        context.saveGState()
        let resizedFrame: CGRect = resizing.apply(rect: CGRect(x: 0, y: 0, width: 317, height: 384), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 317, y: resizedFrame.height / 384)
        
        
        //// Symbol Drawing
        context.saveGState()
        context.translateBy(x: 158.5, y: 192)
        context.rotate(by: -180 * CGFloat.pi/180)
        
        let symbolRect = CGRect(x: -158.5, y: -192, width: 317, height: 384)
        context.saveGState()
        context.clip(to: symbolRect)
        context.translateBy(x: symbolRect.minX, y: symbolRect.minY)
        
        HHStyleKit.drawForwardArrow(frame: CGRect(origin: .zero, size: symbolRect.size), resizing: .stretch)
        context.restoreGState()
        
        context.restoreGState()
        
        context.restoreGState()
        
    }
    
